
CREATE TABLE player(
    player_id int,
    lname varchar(255),
    fname varchar(255),
    jersey int, 
    age int,
    experience int, 
    college varchar(255),
    team varchar(255),
    PRIMARY KEY(player_id)
);

CREATE TABLE teams (
    team_id varchar(3), 
    team_name varchar(255),
    year_founded int, 
    wins int, 
    losses int, 
    conf_titles int,
    coach_name varchar(255),
    PRIMARY KEY(team_id)
);

